INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, 102601, 1, 1, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 10040, 24, "リン", 24001, 0, "あたしだって\nやるときはやるよ！", 0.0, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, 102601, 1, 1, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 10040, 24, "リン", 24002, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, 102601, 1, 1, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 10040, 24, "リン", 24003, 2, "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, 102601, 2, 2, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 10040, 24, "リン", 24004, 3, "やったね！\nこれでようやく\nサボれるよ…", 0.0, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, 102601, 1, 1, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 10040, 24, "リン", 24005, 4, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, 102601, 2, 2, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 10040, 24, "リン", 24006, 5, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, 102601, 2, 2, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 10040, 24, "リン", 24007, 6, "あたしも意外と\nやるもんでしょ？", 0.0, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, 102601, 4, 4, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 10040, 24, "リン", 24008, 7, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, 102601, 4, 4, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 10040, 24, "リン", 24009, 8, "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, 102601, 4, 4, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 10040, 24, "リン", 24010, 9, "まじめに\nやったんだけどな…\n悔しいな～", 0.0, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, 102601, 4, 4, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 10040, 24, "リン", 24011, 10, "やられた…\nねずみって意外と\nてごわいね", 0.0, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, 102601, 4, 4, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 10040, 24, "リン", 24012, 11, "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, 0.0);
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES (0.0, 102601, 1, 4, "2020/04/30 12:00:00", "2030/12/17 14:59:59", 10040, 24, "リン", 24013, 12, "疲れた…\nけど、次こそは\n守り抜くよ…", 0.0, 1.81);
